import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';

// Composants de layout
import Navbar from './components/Navbar';
import Footer from './components/footer';

// Pages publiques
import Home from './components/Home';
import Login from './auth/Login';
import Register from './auth/Register';

// Protection des routes
import PrivateRoute from './auth/PrivateRoute';

// ✅ DASHBOARDS SIMPLIFIÉS (imports directs)
import PatientDashboard from './pages/PatientDashboard';
import AdminDashboard from './pages/AdminDashboard';
import MedecinDashboard from './pages/MedecinDashboard';
import ModerateurDashboard from './pages/ModerateurDashboard';
import ServiceDashboard from './pages/ServiceDashboard';
import PharmacienDashboard from './pages/PharmacienDashboard';

// Pages spécifiques (déjà corrigées)
import MesRendezVous from './pages/patient/MesRendezVous';
import MonDossier from './pages/patient/MonDossier';
import MesConsultations from './pages/patient/MesConsultations';

// Pages médecin
import MesPatients from './pages/medecin/MesPatients';
import MesConsultationsMedecin from './pages/medecin/MesConsultations';
import CreerDossier from './pages/medecin/CreerDossier';
import MesRendezVousMedecin from './pages/medecin/MesRendezVous';
import MesDossiers from './pages/medecin/MesDossiers';

// Pages admin
import Patients from './pages/admin/Patients';
import Medecins from './pages/admin/Medecins';
import Services from './pages/admin/Services';
import Rdv from './pages/admin/Rdv';
import Finances from './pages/admin/Finances';
import Moderateurs from './pages/admin/Moderateurs';
import CreerDossierAdmin from './pages/admin/CreerDossier';
import Consultations from './pages/admin/Consultations';
import Journal from './pages/admin/Journal';
import Ordonnances from './pages/admin/Ordonnances';

function App() {
  return (
    <div className="min-h-screen flex flex-col">
      {/* NAVBAR GLOBALE */}
      <Navbar />

      {/* Contenu principal */}
      <main className="flex-grow">
        <Routes>
          {/* Routes publiques */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* ✅ PATIENT - DASHBOARD COMPLET */}
          <Route 
            path="/patient/*" 
            element={
              <PrivateRoute allowedRoles={['Patient']}>
                <PatientDashboard />
              </PrivateRoute>
            } 
          />

          {/* Ancienne route dashboard → redirect */}
          <Route 
            path="/dashboard" 
            element={
              <Navigate to="/patient" replace />
            } 
          />

          {/* ✅ MEDECIN - DASHBOARD COMPLET */}
          <Route 
            path="/medecin/*" 
            element={
              <PrivateRoute allowedRoles={['Medecin']}>
                <MedecinDashboard />
              </PrivateRoute>
            } 
          />

          {/* ✅ ADMIN - DASHBOARD COMPLET */}
          <Route 
            path="/admin/*" 
            element={
              <PrivateRoute allowedRoles={['Admin']}>
                <AdminDashboard />
              </PrivateRoute>
            } 
          />

          {/* ✅ MODERATEUR */}
          <Route 
            path="/moderateur/*" 
            element={
              <PrivateRoute allowedRoles={['Moderateur']}>
                <ModerateurDashboard />
              </PrivateRoute>
            } 
          />

          {/* ✅ SERVICE */}
          <Route 
            path="/service/*" 
            element={
              <PrivateRoute allowedRoles={['Admin', 'Medecin', 'Assistant']}>
                <ServiceDashboard />
              </PrivateRoute>
            } 
          />

          {/* ✅ PHARMACIEN */}
          <Route 
            path="/pharmacien/*" 
            element={
              <PrivateRoute allowedRoles={['Pharmacien']}>
                <PharmacienDashboard />
              </PrivateRoute>
            } 
          />

          {/* 404 */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </main>

      {/* FOOTER */}
      <Footer />
    </div>
  );
}

export default App;
